import React, { useEffect, useState } from "react";
import "./style.css";
import axios from "axios";

const Main = () => {
  const [movieList,setMovieList]= useState([])
  useEffect(()=>{
    GetMovieList()
  },[])

  const GetMovieList= async()=>{
    try {
      const url = "https://rotten-shoes-refuse.loca.lt/api/public/movies";
      const { data: res } = await axios.get(url);
      console.log(res,"res")
      navigate("/login");
      console.log(res.message);
    } catch (error) {
      if (
        error.response &&
        error.response.status >= 400 &&
        error.response.status <= 500
      ) {
        // setError(error.response.data.message);
      }
    }
  }
  return (
    <div className="desktop">
      <div className="div">
        <div className="overlap-group">
          <div className="rectangle" alt="Rectangle" src="rectangle-2.png" />
          <div className="line" alt="Line" src="line-1.svg" />
          <div className="img" alt="Line" src="line-2.svg" />
          <div>

            <br />

          </div>
          <div className="rectangle-2" alt="Rectangle" src="rectangle-15.png" />
          <div className="text-wrapper"></div>
          <div className="text-wrapper-2"></div>
        </div>
        <div className="overlap">
          <div className="text-wrapper-3">Baby(2023)</div>
          <div className="image" alt="Image" src="image-15.png" />
        </div>
        <div className="overlap-2">
          <div className="overlap-3">
            <div className="image-2" alt="Image" src="image-6.png" />
            <div className="overlap-4">
              <div className="text-wrapper-4">ROCKY AUR RANI</div>
              <div className="text-wrapper-5">Barbie (2023)</div>
              <div className="image-3" alt="Image" src="image-10.png" />
            </div>
            <div className="image-4" alt="Image" src="image-7.png" />
          </div>
          <div className="overlap-5">
            <div className="text-wrapper-6">BRO</div>
            <div className="image-5" alt="Image" src="image-12.png" />
          </div>
        </div>
        <h1 className="h-1">Oppenheimer</h1>
        <div className="image-6" alt="Image" src="image-8.png" />
        <div className="image-7" alt="Image" src="image-9.png" />
        <div className="image-8" alt="Image" src="image-11.png" />
        <div className="image-9" alt="Image" src="image-13.png" />
        <div className="image-10" alt="Image" src="image-14.png" />
      </div>
    </div>
  );
};
export default Main
